const BookData = () => {
    const [productData, setProducts] = useState([])
    useEffect(() => {
        fetch('http://localhost:5000/products')
            .then(res => res.json())
            .then(data => setProducts(data))
    }, [])
    return (
        <section >
            <h2 className="text-center text-brand mb-5 mt-5">Available Bidding Products</h2>
            <div className="row">
                {
                    productData.map(product => <BookingCard product={product} key={product.id}></BookingCard>)
                }
            </div>
        </section>
    );
};

export default BookData;